        $scope.loadParameters = function (search) {
            var query = location.search.substr(1);
            var result = {};
            query.split("&").forEach(function (part) {
                var item = part.split("=");
                result[item[0]] = decodeURIComponent(item[1]);
            });
            return result;
        };

        $scope.toggleImageChart = function () {
            $scope.isSmallChart = !$scope.isSmallChart;
        }

