        $scope.toggleUpdate = function (serverUrl, str, item) {

            if ($scope.dataLoading) {
                return;
            }
            var url = '';
            showSpinner(true);

            var CallBacks = {
                onError: function () {
                    showSpinner(false);
                },
                onSucess: function () {
                    console.log("onSucessCollapse - update");
                    showSpinner(false);
                }
            };

            url = $scope.getServerEditUrl(serverUrl, str, item);
            updateConnectionData(str, item, url, CallBacks, true, false, false);
        }

        function updateConnectionData(str, item, url, Callbacks, reload, isFlagUpdate, isDelete) {
            if (str == "MetricConnections") {
                VsmCrud.updateMetricConnection(item, url, Callbacks, reload, isFlagUpdate, isDelete);
            } else if (str == "CauseConnections") {
                VsmCrud.updateCauseConnection(item, url, Callbacks, reload, isFlagUpdate, isDelete);
            } else if (str == "SolutionConnections") {
                VsmCrud.updateSolutionConnection(item, url, Callbacks, reload, isFlagUpdate, isDelete);
            }
        }

        $scope.openConnection = function (serverUrl, str, item) {
            item.Collapse = !item.Collapse;
            $scope.toggleUpdate(serverUrl, str, item);
        }

