        $scope.getServerUpdateUrl = function (str, item) {

            var url = "https://c0amf816.caspio.com/dp.asp?";

            if (str == "MetricConnections") {
                url = url + "AppKey=ef404000267dce20695d495ba604&cbUI=1&DataValueID=" + item.DataValueID;
            } else if (str == "CauseConnections") {
                url = url + "AppKey=ef4040001342ebc428d64d5bbb55&cbUI=1&CauseImpactID=" + item.CauseImpactID;
            } else if (str == "SolutionConnections") {
                url = url + "AppKey=ef40400025a4f9a6416045669619&cbUI=1&SolutionImpactID=" + item.SolutionImpactID;
            } else if (str == "StepUpdate") {
                url = url + "AppKey=ef404000c4a5d01f3fcb418e8790&cbUI=1&ProcessStepId=" + item.ProcessStepID;
            } else if (str == 'Footers') {
                url = url + "AppKey=ef404000392ff16e737e485196b8&cbUI=1&ProcessID=" + $scope.processID;
            }

            return url;
        };

        $scope.getServerEditUrl = function (serverUrl, str, item) {

            var url = "";

            if (str == "MetricConnections") {
                url = serverUrl + "&cbUI=1&DataValueID=" + item.DataValueID;
            } else if (str == "CauseConnections") {
                url = serverUrl + "&cbUI=1&CauseImpactID=" + item.CauseImpactID;
            } else if (str == "SolutionConnections") {
                url = serverUrl + "&cbUI=1&SolutionImpactID=" + item.SolutionImpactID;
            } else if (str == "StepUpdate") {
                url = serverUrl + "&cbUI=1&ProcessStepId=" + item.ProcessStepID;
            } else if (str == 'Footers') {
                url = serverUrl + "&cbUI=1&ProcessID=" + $scope.processID;
            }

            if (isEmpty(serverUrl))
                url = $scope.getServerUpdateUrl(str, item);

            return url;
        };

