        function addImage2Pdf() {

            var width = doc.internal.pageSize.width;
            var height = doc.internal.pageSize.height;

            console.log(counter);

            html2canvas(objs[counter], {
                scale: 2,
                //allowTaint: true,
                //taintTest: false,
                logging: true,
                onrendered: function (canvas) {

                    counter++;
                    if (counter > 1)
                        doc.addPage();
                    doc.setPage(counter);
                    var imgData = canvas.toDataURL('image/jpeg');
                    doc.addImage(imgData, 'JPEG', 0, 0, width, height);

                    if (counter == objs.length) {
                        showSpinner(false);;
                        doc.save("iVSM.pdf");
                    }
                    else {
                        addImage2Pdf();
                    }
                },
                useCORS: true
            });

        }

