        $scope.deleteConnection = function () {

            $scope.showConfirmModal = false;
            showSpinner(true);
            if ($scope.deleteConnectionObj) {
                var CallBacks = {
                    onError: function () {
                        //$scope.close();
                        alert('Failed to delete');
                        showSpinner(false);
                    },
                    onSucess: function () {
                        //Onload
                        //alert('Deleted Successfully');
                        //$route.reload();
                        reloadData(str);
                        console.log("onSucess - delete");
                        showSpinner(false);
                    }
                };

                var url = $scope.deleteConnectionObj.url;
                var str = $scope.deleteConnectionObj.name;
                var item = $scope.deleteConnectionObj.item;

                if (str == "MetricConnections") {

                    _.remove($scope.metricConnections, { 'DataValueID': item.DataValueID });

                    //url = $scope.getServerUpdateUrl(str, item);
                    VsmCrud.deleteMetricConnection(url, CallBacks);
                }
                else if (str == "CauseConnections") {
                    //url = $scope.getServerUpdateUrl(str, item);
                    VsmCrud.deleteCauseConnection(url, CallBacks);
                }
                else if (str == "SolutionConnections") {
                    //url = $scope.getServerUpdateUrl(str, item);
                    VsmCrud.deleteSolutionConnection(url, CallBacks);
                }
            }
        };

