        var addConnectionForStep = function (item) {

            var CallBacks = {
                onError: function () {
                    //alert('Failed to Add connection');
                },
                onSucess: function () {
                    reloadData($scope.dragItem.type);
                }
            };

            if ($scope.dragItem && item) {

                if ($scope.dragItem.type == "MetricConnections") {
                    var obj = {
                        MetricName: $scope.dragItem.name,
                        ProcessStepID: item.StepDescription
                    };
                    $scope.metricConnections.push(obj);

                    VsmCrud.createMetricConnection($scope.dragItem.name, item.ProcessStepID, CallBacks.onSucess, CallBacks.onError);
                }
                else if ($scope.dragItem.type == "CauseConnections") {
                    var obj = {
                        CauseName: $scope.dragItem.name,
                        ProcessStepID: item.StepDescription
                    };
                    $scope.causeConnections.push(obj);
                    VsmCrud.createCauseConnection($scope.dragItem.name, item.ProcessStepID, CallBacks.onSucess, CallBacks.onError);
                }
                else if ($scope.dragItem.type == "SolutionConnections") {
                    var obj = {
                        SolutionName: $scope.dragItem.name,
                        ProcessStepID: item.StepDescription
                    };
                    $scope.solutionConnections.push(obj);
                    VsmCrud.createSolutionConnection($scope.dragItem.name, item.ProcessStepID, CallBacks.onSucess, CallBacks.onError);
                }

            }
        };

