        var updateStepSequence = function (step1, step2, serverUrl) {

            var firstStepUpdated = false;
            var secondStepUpdate = false;
            var step1_order = step1.StepSequence;
            var url = '';

            showSpinner(true);

            var CallBacks = {
                onError: function () {
                    showSpinner(false);
                    reloadData("Steps"); //throw error dialog to the user
                },
                onSucess: function () {

                    if (!secondStepUpdate) {
                        secondStepUpdate = true;
                        url = $scope.getServerEditUrl(serverUrl, "StepUpdate", step2);
                        VsmCrud.updateStepSequence(step2, url, CallBacks, false);
                    }
                    else if (!firstStepUpdated) {
                        firstStepUpdated = true;
                        step1.StepSequence = step1_order;
                        url = $scope.getServerEditUrl(serverUrl, "StepUpdate", step1);
                        VsmCrud.updateStepSequence(step1, url, CallBacks, false);
                    } else {
                        ////reloadData("Steps");
                        //showSpinner(false);
                        //orderSteps();

                        reloadAll();
                    }
                }
            };

            step1.StepSequence = step1.StepSequence + 10000; //Can't save the same sequence so changing to temp value before changing the order
            url = $scope.getServerEditUrl(serverUrl, "StepUpdate", step1);
            VsmCrud.updateStepSequence(step1, url, CallBacks, false);
        };

