        $scope.metricConnectionFilter = function (el) {
            return filterConnection('METRIC', el);
        };

        $scope.causeConnectionFilter = function (el) {
            return filterConnection('CAUSE', el);
        };

        $scope.solutionConnectionFilter = function (el) {
            return filterConnection('SOLUTION', el);
        };

        var filterConnection = function (name, connectionObj) {

            var exists = false;

            if (name == "METRIC" && connectionObj && connectionObj.hasOwnProperty('MetricName'))
                exists = true;
            else if (name == "CAUSE" && connectionObj && connectionObj.hasOwnProperty('CauseName'))
                exists = true;
            else if (name == "SOLUTION" && connectionObj && connectionObj.hasOwnProperty('SolutionName'))
                exists = true;

            return exists;

        }

        var pageMaxHeight = 560 - 70 - 70 - 60; //70-step height; 70 image height - 60headers
        var metricHeight = 90; // + 20 for extra line title
        var causeHeight = 40;

        function GetNewPages() {
            var Pages = [];

            var startStep = 0;
            var pagenumber = 1;
            var cycles = Math.ceil($scope.steps.length / stepPageCount); //root level pageCount

            for (var i = 0; i < cycles; i++) {

                var endStep = startStep + stepPageCount;

                //For Each Step
                for (var k = startStep; k < endStep && k < $scope.steps.length; k++) {

                    var stepInfo = $scope.steps[k];
                    var allConnections = GetConnectionsForStep(stepInfo);
                    var currentPageNo = pagenumber;

                    var connectionsHeight = 0;
                    var connections = [];
                    var addStep = true;
                    //For each Step connection
                    for (var L = 0; L < allConnections.length; L++) {

                        addStep = true;
                        var c = allConnections[L];
                        var currentHeight = 0;
                        if ($scope.metricConnectionFilter(c))
                            currentHeight = connectionsHeight + metricHeight;
                        else
                            currentHeight = connectionsHeight + causeHeight;

                        if (currentHeight < pageMaxHeight) {
                            connections.push(c);
                            connectionsHeight = currentHeight;
                        }
                        else {

                            var page = getPage(Pages, currentPageNo)

                            var stepObj = {};
                            stepObj.StepsInfo = stepInfo;
                            stepObj.Connections = connections;
                            page.Steps.push(stepObj);

                            connectionsHeight = 0;
                            connections = [];
                            currentPageNo++;
                            addStep = false;
                            L--;
                        }
                    }

                    if (addStep) {
                        var page = getPage(Pages, currentPageNo)

                        var stepObj = {};
                        stepObj.StepsInfo = stepInfo;
                        stepObj.Connections = connections;
                        page.Steps.push(stepObj);

                    }
                }
                startStep = endStep;
                pagenumber = Pages.length + 1; //root level increment
            }

            pageStepsCorrection(Pages);

            $scope.AllStepPages = GetAllStepPages(pagenumber);

            return Pages;
        }

        function getPage(Pages, pageno) {

            if (Pages && Pages[pageno - 1]) {
                return Pages[pageno - 1]
            }
            else {
                var page = {};
                page.PageNumber = pageno;
                page.Steps = [];
                currentPage = page;
                Pages.push(page);

                return page;
            }
        }

        $scope.getCurrentDate = function () {
            return moment().format('LL');
        }

        var pageStepsCorrection = function (Pages) {

            try {
                if (Pages) {
                    var cycles = Math.ceil($scope.steps.length / stepPageCount); //root level pageCount

                    for (var i = 1; i < Pages.length; i++) {

                        if (Pages[i].Steps && Pages[i].Steps.length < stepPageCount) {

                            var previousPage = Pages[i - 1];

                            if (previousPage.Steps && previousPage.Steps.length == stepPageCount) {

                                var match = false;
                                //Check PreviousPage steps match with currentPage
                                for (var j = 0; j < previousPage.Steps.length; j++) {
                                    for (var k = 0 ; k < Pages[i].Steps.length; k++) {
                                        if (previousPage.Steps[j].StepsInfo.StepName == Pages[i].Steps[k].StepsInfo.StepName) {
                                            match = true;
                                            break;
                                        }
                                    }
                                }

                                //fix up missing steps
                                if (match) {
                                    for (var p = 0; p < previousPage.Steps.length; p++) {
                                        //if (Pages[i].Steps.length > p && Pages[i].Steps[p].StepsInfo &&
                                        //    previousPage.Steps[p].StepsInfo.StepName != Pages[i].Steps[p].StepsInfo.StepName) {
                                        //    var stepObj = {};
                                        //    stepObj.StepsInfo = previousPage.Steps[p].StepsInfo;
                                        //    stepObj.Connections = null;
                                        //    Pages[i].Steps.splice(p, 0, stepObj);
                                        //}
                                        if (!Pages[i].Steps[p] ||
                                           (previousPage.Steps[p].StepsInfo.StepName != Pages[i].Steps[p].StepsInfo.StepName)) {
                                            var stepObj = {};
                                            stepObj.StepsInfo = previousPage.Steps[p].StepsInfo;
                                            stepObj.Connections = null;
                                            Pages[i].Steps.splice(p, 0, stepObj);
                                        }
                                    }
                                }
                            }
                        }
                    }
                }
            }
            catch (err) {
                console.log(err);
            }

        };


